import fetch from 'isomorphic-unfetch'
import Layout from '../components/layout'
import 'bootstrap/dist/css/bootstrap.min.css';

export default function NewsSection() {
    return (
        <Layout>
            <h1>Headline</h1>
            <ul>
                {props.news.map(news => (
                    <li>
                        <a href={news.url} target="_blank">{news.title}</a>
                    </li>
                ))}
            </ul>
        </Layout>
    )
}
